const styles = theme => ({
    questionPaper: {
        width: "50vw",
        marginTop: theme.spacing(2),
    },
    mainArea: {
        flexGrow: 1,
    },
    contentInput: {
        width: "35vw",
        marginBottom: theme.spacing(2),
    },
    optionIcon: {
        margin: theme.spacing(3, 2, 1, 2),
    },
    optionInput: {
        margin: theme.spacing(1, 2, 1, 2),
    },
    cascadeInput: {
        margin: theme.spacing(1, 2, 1, 2),
        width: theme.spacing(10),
    }
});

export default styles;
